import { ACTIONS_TYPES } from "../actions/usuario";
const initialState = {
    list:[]
}


export const usuario = (state=initialState.action) => {
    switch (action.types) {
        case ACTIONS_TYPES.FETCH_ALL:
            return {
                ...state,
                list:[...action.payload]
            }
    
        default:
            return state;
    }
}
